// /src/components/CharacterList.tsx
import React from 'react';
import { useCharactersWithMultipleActors } from '../hooks/useCharacters';
const CharacterList = () => {
  const { data: charactersData, loading, error } = useCharactersWithMultipleActors();

  return (
    <div>
      <h1>Characters with Multiple Actors</h1>
      {loading && <p>Loading...</p>}
      {error && <p>Error: {error}</p>}
      {}
      <ul>
        {Object.keys(charactersData).map((character) => (
          <li key={character}>
            <h2>{character}</h2>
            <ul>
              {charactersData[character].map((entry, idx) => (
                <li key={idx}>
                  {entry.movieName} - {entry.actorName}
                </li>
              ))}
            </ul>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default CharacterList;
